','Sorry, you are not allowed to read the block editor settings.'=>'Na ndjeni, s’keni leje të lexoni rregullimet e përpunuesit të blloqeve.','Enables experimental Site Editor blocks'=>'Aktivizon blloqe eksperimentale Përpunues Sajti','block titleTerm Description'=>'Përshkrim Termi','block descriptionDisplay the description of categories, tags and custom taxonomies when viewing an archive.'=>'Shfaqni përshkrimin e kategorive, etiketave dhe klasifikimeve vetjake, kur shihet një arkiv.','block titleComments Link'=>'Lidhje Komentesh','block titleLogin/out'=>'Hyrje/dalje','block titleCustom Link'=>'Lidhje Vetjake','Embed of %s.'=>'Trupëzim i %s.','PDF embed'=>'Trupëzim PDF','A link to a post format'=>'Një lidhje te format postimesh','Post Format Link'=>'Lidhje Formati Postimesh','This content is password protected.'=>'Kjo lëndë mbrohet me fjalëkalim.','%1$s comment<span class="screen-reader-text"> on %2$s</span>'=>'%1$s koment<span class="screen-reader-text"> te %2$s</span>' . "\0" . '%1$s komente<span class="screen-reader-text"> te %2$s</span>','No comments<span class="screen-reader-text"> on %s</span>'=>'Pa komente<span class="screen-reader-text"> te %s</span>','block titlePage List'=>'Listë Faqesh','label for previous post linkPrevious'=>'I mëparshmi','label for next post linkNext'=>'Pasuesi','block descriptionEdit the different global regions of your site, like the header, footer, sidebar, or create your own.'=>'Përpunoni rajonet e ndryshme globale të sajtit tuaj, bie fjala, kryefaqen, fundfaqen, anështyllën, ose krijoni tuajat.','Previous Page'=>'Faqja e Mëparshme','Next Page'=>'Faqja Pasuese','Template part has been deleted or is unavailable: %s'=>'Pjesa e gjedhes është fshirë ose s’kihet dot: %s','block titleComments Page Numbers'=>'Numra Faqesh Komentesh','[block rendering halted]'=>'[rikrijimi i bllokut u ndal]','block titleTemplate Part'=>'Pjesë Gjedheje','block titleSite Title'=>'Titull Sajti','block titleSite Tagline'=>'Moto Sajti','block titleSite Logo'=>'Logo Sajti','block titleSocial Icon'=>'Ikonë Shoqërorësh','block titleSocial Icons'=>'Ikona shoqërorësh','block titleTag Cloud'=>'Re Etiketash','block titleVideo'=>'Video','block titleVerse'=>'Varg','block titleText Columns (deprecated)'=>'Shtylla Teksti (nxjerrë nga përdorimi)','block titleTable'=>'Tabelë','block titleSpacer'=>'Hapësirë','block titleShortcode'=>'Kod i shkurtër','block titleSeparator'=>'Ndarës','block titleGroup'=>'Grup','block titleSearch'=>'Kërkim','block titleRSS'=>'RSS','block titlePullquote'=>'Citim i nxjerrë në pah','block titlePreformatted'=>'I paraformatuar','block titlePage Break'=>'Ndërprerje Faqeje','block titleMore'=>'Më tepër','block titleUnsupported'=>'I pambuluar','block titleList'=>'Listë','block titleLatest Posts'=>'Postimet Më të Reja','block titleLatest Comments'=>'Komentet Më të Reja','block titleNavigation'=>'Lëvizje','block titleMedia & Text'=>'Media & Tekst','block titleCustom HTML'=>'HTML Vetjake','block titleFile'=>'Kartelë','block titleCover'=>'Mbulesë','block titleColumn'=>'Shtyllë','block titleColumns'=>'Shtylla','block titleCode'=>'Kod','block titleCalendar'=>'Kalendar','block titleButtons'=>'Butona','block titleButton'=>'Buton','block titleAudio'=>'Audio','block titleArchives'=>'Arkiva','block titleGallery'=>'Galeri','block titleQuote'=>'Citim','block titleHeading'=>'Krye','block titleImage'=>'Figurë','block titleParagraph'=>'Paragraf','block titlePost Terms'=>'Terma Postimi','block titleQuery Loop'=>'Query Loop','block titleComment Date'=>'Datë Komenti','block titleComment Content'=>'Lëndë Komenti','block titleFeatured Image'=>'Figurë e Zgjedhur','block titleComments Form'=>'Formular Komentesh','block titleComments Count'=>'Numër Komentesh','Sorry, you are not allowed to access the templates on this site.'=>'Na ndjeni, s’keni leje të hyni te gjedhet në këtë sajt.','The id of a template'=>'ID-ja e gjedhes','Font Family'=>'Familje Shkronjash','Whether to bypass Trash and force deletion.'=>'Të anashkalohet apo jo Shpënia te Hedhurinat dhe të bëhet fshirje e detyruar.','Site logo.'=>'Logo sajti.','by %s'=>'nga %s','No pattern categories'=>'Pa kategori modelesh','Search results'=>'Përfundime kërkimi','Patterns'=>'Modele','Content'=>'Lëndë','Menu'=>'Menu','Home'=>'Hyrje','Sorry, you are not allowed to edit posts in this post type.'=>'Na ndjeni, s’keni leje të përpunoni postime të këtij lloji postimesh.','Font faces do not support trashing. Set "%s" to delete.'=>'Për <em>font faces</em> nuk mbulohet shpënia në hedhurina. Vini “%s”, që të fshihen.','block keywordlinks'=>'lidhje','The block editor includes experimental features that are useable while they\'re in development. Select the ones you\'d like to enable. These features are likely to change, so avoid using them in production.'=>'Përpunuesi me blloqe përfshin veçori eksperimentale që mund të përdoren, teksa janë ende duke u zhvilluar. Përzgjidhni ato që doni të aktivizohen. Këto veçori ka shumë gjasa të ndryshojnë, ndaj shmangni përdorimin e tyre në prodhim.','Experiments Settings'=>'Rregullime Eksperimentesh','Experimental settings'=>'Rregullime eksperimentale','An error has occurred, which probably means the feed is down. Try again later.'=>'Ndodhi një gabim, i cili, sipas gjasash, do të thotë që prurja s’po funksionon. Riprovoni më vonë.','RSS Error:'=>'Gabim RSS-je:','Search'=>'Kërko','Word count type. Do not translate!words'=>'words','block titleEmbed'=>'Trupëzim','block titleClassic'=>'Klasik','block descriptionIntroduce new sections and organize content to help visitors (and search engines) understand the structure of your content.'=>'Përdorni ndarje të reja dhe sistemojeni lëndën tuaj për t’i ndihmuar vizitorët (dhe motorët e kërkimit) të kuptojnë strukturë e saj.','block descriptionGive quoted text visual emphasis. "In quoting others, we cite ourselves." — Julio Cortázar'=>'Jepini tekstit të cituar një theksim pamor. “Duke cituar të tjerët, ne citojmë vetveten”. — Hulio Kortazar','M j, Y g:i a'=>'j M Y, @ g:i a','Medium'=>'Medium','No archives to show.'=>'S’ka arkiva për shfaqje.','Title'=>'Titull','Beautiful landscape'=>'Panoramë e bukur','Thanks for testing Gutenberg!'=>'Faleminderit që testoni Gutenberg-un!','Help build Gutenberg'=>'Ndihmoni në ngritjen e Gutenberg-ut','Code is Poetry'=>'Kodi është Poezi','Matt Mullenweg, 2017'=>'Matt Mullenweg, 2017','If you want to learn more about how to build additional blocks, or if you are interested in helping with the project, head over to the <a href="%s">GitHub repository</a>.'=>'Nëse doni të mësoni më tepër rreth se si të krijohen blloqe shtesë, ose nëse interesoheni të ndihmoni në projekt, shkoni te <a href="%s">depoja në GitHub</a>.','You can build any block you like, static or dynamic, decorative or plain. Here&#8217;s a pullquote block:'=>'Mund të krijoni çfarëdo blloku që doni, statik ose dinamik, zbukurues ose të thjeshtë. Ja një bllok për citime:','Any block can opt into these alignments. The embed block has them also, and is responsive out of the box:'=>'Any block can opt into these alignments. The embed block has them also, and is responsive out of the box:','Sure, the full-wide image can be pretty big. But sometimes the image is worth it.'=>'Sigurisht, figura në madhësi të plotë mund të jetë goxha e madhe. Por ngandonjëherë figura e ka hak këtë.','Accessibility is important &mdash; don&#8217;t forget image alt attribute'=>'Përdorshmëria nga kushdo është e rëndësishme &mdash; mos harroni të shtoni atribut alt për figurat','If you combine the new <strong>wide</strong> and <strong>full-wide</strong> alignments with galleries, you can create a very media rich layout, very quickly:'=>'Nëse ndërthurni drejtimet e reja <strong>i gjerë</strong> dhe <strong>gjerësi e plotë</strong> me galeri, mund të krijoni një skemë shumë të larmishme për media, dhe shumë shpejt:','You can change the amount of columns in your galleries by dragging a slider in the block inspector in the sidebar.'=>'Sasinë e shtyllave në galerinë tuaj mund të ndryshoni duke tërhequr një rrëshqitës te mbikëqyrësi i bllokut, te anështylla.','Blocks can be anything you need. For instance, you may want to add a subdued quote as part of the composition of your text, or you may prefer to display a giant stylized one. All of these options are available in the inserter.'=>'Blloqet mund të jenë ç’të keni nevojë. Për shembull, mund të doni të shtoni një citim si pjesë e hartimit të tekstit tuaj, ose mund të doni të shfaqni një të tillë gjigant dhe të stilizuar. Krejt këto mundësi i gjeni te futësi.','The information corresponding to the source of the quote is a separate text field, similar to captions under images, so the structure of the quote is protected even if you select, modify, or remove the source. It&#8217;s always easy to add it back.'=>'Të dhënat që i përgjigjen burimit të citimit janë një fushë teksti më vete, si titujt nën figura, kështu që struktura e citimit është e mbrojtur edhe kur përzgjidhni, modifikoni ose e hiqni fare burimin. Është përherë e lehtë ta shtoni më vonë.','The editor will endeavor to create a new page and post building experience that makes writing rich posts effortless, and has “blocks” to make it easy what today might take shortcodes, custom HTML, or “mystery meat” embed discovery.'=>'Përpunuesi do të përpiqet të krijojë një metodë të re ndërtimi faqesh dhe postimesh, e cila e bën të pamundimshëm shkrimin e postimeve të pasur, dhe përmban “blloqe” për ta bërë të kollajtë atë për të cilën sot duhen kode të shkurtër, HTML vetjake, apo nuhatje rreth përmbajtjes së trupëzimeve të mistershme.','The WordPress community'=>'Bashkësia WordPress','The above is a gallery with just two images. It&#8217;s an easier way to create visually appealing layouts, without having to deal with floats. You can also easily convert the gallery back to individual images again, by using the block switcher.'=>'Më sipër keni një galeri me vetëm dy figura. Bëhet fjalë për një rrugë më të lehtë për krijim skemash tërheqëse nga ana pamore, pa u dashur të merreni me elementë pezull. Galerinë mund ta riktheni lehtësisht te figura individuale, duke përdorur këmbyesin e bllokut.','Media Rich'=>'I pasur Me Media','Visual Editing'=>'Përpunim Pamor','Galleries'=>'Galeri','Images &amp; Videos'=>'Figura &amp; Video','Text &amp; Headings'=>'Tekst &amp; Krye','Welcome to the Gutenberg Editor'=>'Mirë e vini te Përpunuesi Gutenberg','The <em>Inserter</em> Tool'=>'Mjeti i <em>Futjeve</em>','A huge benefit of blocks is that you can edit them in place and manipulate your content directly. Instead of having fields for editing things like the source of a quote, or the text of a button, you can directly change the content. Try editing the following quote:'=>'Një përfitim shumë i madh nga blloqet është se mund t’i përpunoni ata në vend dhe të manipuloni lëndën e tyre drejtpërsëdrejti. Në vend të fushave për përpunim gjërash të tilla si burimi i një citimi, apo teksti i një butoni, mund të ndryshoni lëndën drejtpërdrejt. Provoni të përpunoni citimin vijues:','And <em>Lists</em> like this one of course :)'=>'Dhe <em>Lista</em> si kjo, sigurisht :)','Layout blocks, like Buttons, Hero Images, Separators, etc.'=>'Blloqe skeme, f.v. Butona, Figura Hero, Ndarës, etj.','Embeds, like YouTube, Tweets, or other WordPress posts.'=>'Trupëzime, b.f., nga YouTube, Tweets, apo postime të tjera WordPress.','Go give it a try, you may discover things WordPress can already add into your posts that you didn&#8217;t know about. Here&#8217;s a short list of what you can currently find there:'=>'Provojeni, mund të zbuloni gjëra që s’e dinit se WordPress-i mund t’i shtojë tashmë te postimet tuaja. Ja një listë e shkurtër se ç’mund të gjeni:','A Picture is Worth a Thousand Words'=>'Një Pamje vlen Sa Një Mijë Fjalë','... like this one, which is right aligned.'=>'… si kjo, që është e vendosur majtas.','If your theme supports it, you&#8217;ll see the "wide" button on the image toolbar. Give it a try.'=>'Nëse mbulohet nga tema juaj, do të shihni butonin "e gjerë" te paneli i figurave. Provojeni.','Headings are separate blocks as well, which helps with the outline and organization of your content.'=>'Tituj janë gjithashtu blloqe më vete, gjë që ndihmon në përvijimin dhe sistemimin e lëndës tuaj.','What you are reading now is a <strong>text block</strong> the most basic block of all. The text block has its own controls to be moved freely around the post...'=>'Ajo që po lexoni tani është një <strong>bllok teksti</strong>, blloku më i themelor nga të tërë. Blloku i tekstit ka kontrollet e veta për t’u lëvizur lirisht nëpër postim…','Imagine everything that WordPress can do is available to you quickly and in the same place on the interface. No need to figure out HTML tags, classes, or remember complicated shortcode syntax. That&#8217;s the spirit behind the inserter—the <code>(+)</code> button you&#8217;ll see around the editor—which allows you to browse all available content blocks and add them into your post. Plugins and themes are able to register their own, opening up all sort of possibilities for rich editing and publishing.'=>'Përfytyroni gjithçka që mund të bëjë WordPress-i ta keni në dorë shpejt dhe në të njëjtin vend te ndërfaqja. Pa u dashur të merrni vesh etiketa HTML, klasa, apo të mbani mend sintaksë të ndërlikuar kodesh të shkurtër. Kjo është ideja pas futësit—butoni <code>(+)</code> që do të shihni nëpër përpunues—i cili ju lejon të shfletoni krejt blloqet e gatshëm të lëndës dhe t’i shtoni ata te postimi juaj. Shtojcat dhe temat janë në gjendje të regjistrojnë blloqe të tyret, duke hapur rrugën për gjithë llojet e mundësive për përpunim dhe botim të pasur.','Try selecting and removing or editing the caption, now you don&#8217;t have to be careful about selecting the image or other text by mistake and ruining the presentation.'=>'Provoni të përzgjidhni ose përpunoni përshkrimin, tani nuk ju duhet të më të jeni i kujdesshëm se mos përzgjidhni gabimisht figurën apo tjetër tekst dhe të rrënoni paraqitjen.','Handling images and media with the utmost care is a primary focus of the new editor. Hopefully, you&#8217;ll find aspects of adding captions or going full-width with your pictures much easier and robust than before.'=>'Trajtimi me kujdesin më të madh të figurave dhe objekteve media është objektivi i parë i përpunuesit të ri. Shpresojmë se shtimi i legjendave apo kalimi në gjerësi të plotë i figurave tuaja do t’ju duken shumë të lehta dhe të fuqishme se më parë.','Of Mountains &amp; Printing Presses'=>'Mbi Malet &amp; Shtypshkronjat','The goal of this new editor is to make adding rich content to WordPress simple and enjoyable. This whole post is composed of <em>pieces of content</em>—somewhat similar to LEGO bricks—that you can move around and interact with. Move your cursor around and you&#8217;ll notice the different blocks light up with outlines and arrows. Press the arrows to reposition blocks quickly, without fearing about losing things in the process of copying and pasting.'=>'Synimi i përpunuesit të ri është ta bëjë të thjeshtë dhe të pëlqyeshëm shtimin e lëndës së pasur te WordPress. Ky postim përbëhet i tëri nga <em>pjesë lënde</em>—diçka e ngjashme me blloqet LEGO—që mund t’i lëvizni dhe ndërveproni me to. Lëvizeni kursorin tuaj përqark dhe do të vini re që blloqe të ndryshëm sikur përmenden, me përvijime dhe shigjeta. Shtypni shigjetat që t’i ripozicioni blloqet shpejt e shpejt, pa frikë se mos humbë gjë gjatë procesit të kopjimit dhe ngjitjes.','The page number requested is larger than the number of pages available.'=>'Numri i kërkuar për faqe është më i madh se numri i faqeve që gjenden.','Small'=>'E vogël','Unique identifier for the font face.'=>'Identifikues unik për <em>font face</em>-in.','%1$s on %2$s'=>'%1$s në %2$s','Archives'=>'Arkiva','Support'=>'Asistencë','No comments to show.'=>'S’ka komente për shfaqje.','Select Post'=>'Përzgjidhni Postim','Select Week'=>'Përzgjidhni Javë','Select Day'=>'Përzgjidhni Ditë','Select Month'=>'Përzgjidhni Muaj','Select Year'=>'Përzgjidhni Vit','https://wordpress.org/support/plugin/gutenberg/'=>'https://wordpress.org/support/plugin/gutenberg/','Large'=>'E madhe','block descriptionAdd a block that displays content pulled from other sites, like Twitter or YouTube.'=>'Shtoni një bllok që shfaq lëndë të marrë nga sajte të tjerë, b.f. Twitter, ose YouTube.','Pagination'=>'Faqosje','Categories'=>'Kategori','Edit'=>'Përpunoni','Close'=>'Mbylle','(no title)'=>'(pa titull)','Block'=>'Bllok','Read more'=>'Lexoni më tepër','Experiments'=>'Eksperimente','Gutenberg development mode requires files to be built. Run <code>npm install</code> to install dependencies, <code>npm run build</code> to build the files or <code>npm run dev</code> to build the files and watch for changes. Read the <a href="https://github.com/WordPress/gutenberg/blob/HEAD/docs/contributors/code/getting-started-with-code-contribution.md">contributing</a> file for more information.'=>'Mënyra zhvillim për Gutenberg-un lyp kartela, që të montohet. Xhironi <code>npm install</code> që të instaloni varësitë, <code>npm run build</code> që të montohen kartelat, ose <code>npm run dev</code> që të montohen kartelat dhe të shihet për ndryshime. Për më tepër të dhëna, lexoni te kartela <a href="https://github.com/WordPress/gutenberg/blob/HEAD/docs/contributors/code/getting-started-with-code-contribution.md">për dhënie ndihmese</a>.','Unique identifier for the revision.'=>'Identifikues unik për rishikimin.','Documentation'=>'Dokumentim','Select Category'=>'Përzgjidhni Kategori','Gutenberg Team'=>'Ekipi Gutenberg','https://github.com/WordPress/gutenberg'=>'https://github.com/WordPress/gutenberg','Gutenberg'=>'Gutenberg','Demo'=>'Demo','g:i a'=>'g:i a','%s ago'=>'%s më parë','%s from now'=>'%s nga tani','Gutenberg requires WordPress %s or later to function properly. Please upgrade WordPress before activating Gutenberg.'=>'Që të funksionojë si duhet, Gutenbergu lyp WordPress %s ose të mëvonshëm. Ju lutemi, përmirësoni WordPress-in, përpara se të aktivizoni Gutenberg-un.','F j, Y g:i a'=>'j F Y, g:i a','F j, Y'=>'j F Y']];